import React from 'react';
import './App.css';
import Routes from './routes/Routes';
import ParticlesBg from 'particles-bg';

export default function App() {
  return (
    <div className='App container'>
      <ParticlesBg type='square' bg={true} num={20} />
      <Routes />
    </div>
  );
}
